import React,{useState,useEffect} from 'react';
import bc from '../../assets/Back.png'
import logo from '../../assets/ENTIMO30.png';
import styled from 'styled-components';
import axios from 'axios';
import {NavLink,} from "react-router-dom";
const Profile = () => {
    const [user,setfullname]=useState([]);
    
    useEffect(()=>{
        const url="http://localhost:5000/api/aboutus";
       
        axios
      .get(url, { withCredentials: true })
      .then((response) => {
        setfullname(response.data);
      })
      .catch((error) => {
        console.error(error);
      });

    });
    return (
   <Container >
         <Nav>
         <Logo></Logo> 
         <NavLink to="/Login"  ><Login>Log In</Login></NavLink>
         <NavLink to="/SignUp"  ><Signup>Join Now</Signup></NavLink>
         </Nav>
         <LeftContainer>
           <Header/>
           <Headerbar>
             <Headerbarmytask/>
             <Headerbarmytask/>
             </Headerbar>
           </LeftContainer>
  
  </Container>
    )
}
const Container = styled.div`
position: absolute;
width: 100%;
height: 100%;
min-height: 900px;
background-repeat: no-repeat;
background-size: cover;
background-image: url(${bc});

`;
const Nav = styled.nav`
position: absolute;
display: flex;
height: 157px;
width: 100%;
background: rgba(3,0,0,0);
margin: 0 auto;
`;
const Logo= styled.div
`
position: absolute;
width: 146.01px;
height: 145px;
left: 120px;
top: 8px;
text-align: center;
background-image: url(${logo});
background-size: cover;
`;
const Login= styled.div
`
position: absolute;
width: 82px;
height: 38px;
left: 900px;
top: 61px;
font-family: Poppins;
font-style: normal;
font-weight: 500;
font-size: 25px;
line-height: 37px;
/* identical to box height */
text-align: center;
color: #000000;
`
const Signup= styled.div
`
position: absolute;
width: 128px;
height: 38px;
left: 1107px;
top: 61px;
font-family: Poppins;
font-style: normal;
font-weight: 500;
font-size: 25px;
line-height: 37px;
/* identical to box height */
text-align: center;
color: #000000;
`
export default Profile;
const LeftContainer = styled.div`
position: absolute;
width: 717px;
height: 723px;
left: 120px;
top: 177px;
display: flex;
flex-direction: column;
    align-items: center;
background: #FAF8F9;

`;
const Header = styled.div`
width: 717px;
height: 130px;
left: 120px;
top: 177px;
background-color: red;
`;
const Headerbar = styled.div`
width: 400.25px;
height: 48px;
background-color: black;
`;
const Headerbarmytask = styled.div`
width: 200.38px;
height: 48px;
background-color: red;
`;
